EDCS_Status_Code
EDCS_Map3p1EnumerantCode
(
          EDCS_Integer                               ea_3p1_code_in,
          EDCS_Integer                               ee_3p1_code_in,
    const EDCS_3p1_4px_Enumerant_Mapping_Structure **mapping_info_out_ptr
)
{
    EDCS_Status_Code status = EDCS_SC_SUCCESS;

    if (!mapping_info_out_ptr)
    {
        status = EDCS_SC_NULL_REQUIRED_PARAMETER;
    }
    else if (!edcs_mapping_initialized)
    {
        fprintf(stderr, "Error: must call EDCS_Init3p1MappingInfo() before using this function\n");
        status = EDCS_SC_OTHER_FAILURE;
    }
    else if (ea_3p1_code_in < 1 || ea_3p1_code_in > EDCS_3P1_TOTAL_EA || ee_3p1_code_in < 1 ||
             EDCS_EnumMappingLookup_Array[ea_3p1_code_in-1].enum_count == 0 ||
             ee_3p1_code_in > EDCS_EnumMappingLookup_Array[ea_3p1_code_in-1].enum_count)
    {
        *mapping_info_out_ptr = NULL;
        status = EDCS_SC_INVALID_INPUT_CODE;
    }
    else
    {
        *mapping_info_out_ptr = &(EDCS_EnumMappingLookup_Array[ea_3p1_code_in-1].enum_mappings[ee_3p1_code_in-1]);
    }
    return status;
} /* end EDCS_Map3p1EnumerantCode */

EDCS_Status_Code
EDCS_Map3p1EnumerantLabel
(
          EDCS_Integer                               ea_3p1_code_in,
    const char                                      *ee_3p1_label_in,
    const EDCS_3p1_4px_Enumerant_Mapping_Structure **mapping_info_out_ptr
)
{
    EDCS_Status_Code status = EDCS_SC_SUCCESS;

    if (!mapping_info_out_ptr || !ee_3p1_label_in)
    {
        status = EDCS_SC_NULL_REQUIRED_PARAMETER;
    }
    else if (!edcs_mapping_initialized)
    {
        fprintf(stderr, "Error: must call EDCS_Init3p1MappingInfo() before using this function\n");
        status = EDCS_SC_OTHER_FAILURE;
    }
    else if (ea_3p1_code_in < 1 || ea_3p1_code_in > EDCS_3P1_TOTAL_EA)
    {
        status = EDCS_SC_INVALID_INPUT_CODE;
    }
    else
    {
        int i;

        for (i = 0;
             i < EDCS_EnumMappingLookup_Array[ea_3p1_code_in-1].enum_count;
             i++)
        {
            if (!edcs_internal_strcmp(ee_3p1_label_in,
                EDCS_EnumMappingLookup_Array[ea_3p1_code_in-1].
                     enum_mappings[i].ee_3p1_label))
            {
                break;
            }
        }

        if (i == EDCS_EnumMappingLookup_Array[ea_3p1_code_in-1].enum_count)
        {
            status = EDCS_SC_INVALID_INPUT_LABEL;
        }
        else
        {
            *mapping_info_out_ptr = &(EDCS_EnumMappingLookup_Array[ea_3p1_code_in-1].enum_mappings[i]);
        }
    }
    return status;
} /* end EDCS_Map3p1EnumerantLabel */

EDCS_Status_Code
EDCS_3p1EnumerantCodeFromLabel
(
          EDCS_Integer  ea_3p1_code_in,
    const char         *ee_3p1_label_in,
          EDCS_Integer *ee_3p1_code_out
)
{
    EDCS_Status_Code status = EDCS_SC_SUCCESS;

    if (!ee_3p1_code_out || !ee_3p1_label_in)
    {
        status = EDCS_SC_NULL_REQUIRED_PARAMETER;
    }
    else if (!edcs_mapping_initialized)
    {
        fprintf(stderr, "Error: must call EDCS_Init3p1MappingInfo() before using this function\n");
        status = EDCS_SC_OTHER_FAILURE;
    }
    else if (ea_3p1_code_in < 1 || ea_3p1_code_in > EDCS_3P1_TOTAL_EA)
    {
        status = EDCS_SC_INVALID_INPUT_CODE;
    }
    else
    {
        int i;

        for (i = 0;
             i < EDCS_EnumMappingLookup_Array[ea_3p1_code_in-1].enum_count;
             i++)
        {
            if (!edcs_internal_strcmp(ee_3p1_label_in,
                EDCS_EnumMappingLookup_Array[ea_3p1_code_in-1].
                     enum_mappings[i].ee_3p1_label))
            {
                break;
            }
        }

        if (i == EDCS_EnumMappingLookup_Array[ea_3p1_code_in-1].enum_count)
        {
            status = EDCS_SC_INVALID_INPUT_LABEL;
        }
        else
        {
            *ee_3p1_code_out = i + 1;
        }
    }
    return status;
} /* end EDCS_3p1EnumerantCodeFromLabel */

static void
local_shutdown_ee_mapping(void)
{
    EDCS_Count   i;
    EDCS_Integer j;

    for (i = 0; i < EDCS_3P1_TOTAL_EA; i++)
    {
        for (j = 0; j < EDCS_EnumMappingLookup_Array[i].enum_count; j++)
        {
            /* any strings in the individual entry_list entries are statically initialized */
            free(EDCS_EnumMappingLookup_Array[i].enum_mappings[j].entry_list);
            EDCS_EnumMappingLookup_Array[i].enum_mappings[j].entry_list = NULL;
        }
    }
} /* end local_shutdown_ee_mapping */

EDCS_Status_Code
EDCS_Init3p1MappingInfo(void)
{
    EDCS_Status_Code status = EDCS_SC_SUCCESS;

    if (edcs_mapping_initialized == EDCS_FALSE)
    {
        if (((status = local_init_ec_mapping()) == EDCS_SC_SUCCESS) &&
            ((status = local_init_ee_mapping()) == EDCS_SC_SUCCESS))
        {
            edcs_mapping_initialized = EDCS_TRUE;
        }
    }
    return status;
} /* end EDCS_Init3p1MappingInfo */

EDCS_Status_Code
EDCS_Shutdown3p1MappingInfo(void)
{
    if (edcs_mapping_initialized)
    {
        local_shutdown_ec_mapping();
        local_shutdown_ee_mapping();
        edcs_mapping_initialized = EDCS_FALSE;
    }
    return EDCS_SC_SUCCESS;
}
